//danielgafni.github.io/website/pr-preview/pr-6/projects/":{"tf":1.0}},"df":1}}}}}}}}}},"documentStore":{"save":true,"docs":{"https://danielgafni.github.io/website/pr-preview/pr-6/":{"body":"\n\n\n\nThis is my personal website. Itâ€™s WIP.\n","id":"https://danielgafni.github.io/website/pr-preview/pr-6/","title":"Home"},"https://danielgafni.github.io/website/pr-preview/pr-6/about/":{"body":"Iâ€™m an ML/MLOps engineer, professional big data wrangler, Linux enthusiast, OSS believer and contributor, and a corgi owner.\n\n\n\nMy CV can be found here.\n","id":"https://danielgafni.github.io/website/pr-preview/pr-6/about/","title":"About"},"https://danielgafni.github.io/website/pr-preview/pr-6/archive/":{"body":"","id":"https://danielgafni.github.io/website/pr-preview/pr-6/archive/","title":"Archive"},"https://danielgafni.github.io/website/pr-preview/pr-6/blog/":{"body":"Blog posts\n","id":"https://danielgafni.github.io/website/pr-preview/pr-6/blog/","title":"Blog"},"https://danielgafni.github.io/website/pr-preview/pr-6/blog/custom-dagster-asset-decorator/":{"body":"This blog post assumes some knowledge of Dagster - a modern data orchestration framework.\nIntroduction\nWhen building data pipelines, itâ€™s common to work with multiple similar data assets. \nThese assets might differ in small details, like: \n\nhow is the input table being filtered\nwhich transformation is being applied\nwhich entities are included in the data\nwhich machine learning model is being applied\n\nBut share similarities such as:\n\nusing standard naming conventions\nproducing text and metadata logs\nhaving the same columns\n\nAt first itâ€™s easy to add them by copy-pasting existing code. But what if there are dozens of such assets? How do we keep our code maintainable and DRY? Asset Factories to the resque! \nAsset Factories\nThe Asset Factory is a design pattern which can be used to generate multiple similar assets definitions. The idea is to define a function which produces assets based on some (varying) input parameters. This factory encapsulates the common logic for creating the assets, while allowing the specific details to be customized for each asset.\nLetâ€™s say, we have a machine learning model which predicts client churn probability for the next month. We would like to maintain tables for groups of users which are likely to churn with different tresholds. \nHere is a simple example of an Asset Factory which achieves this goal:\n\nWe now have 3 different assets which only differ in filtering tresholds. \nThe codebase can quickly turn in chains of such generated assets. Multiple factories will pass assets to from one to another. Thus, it becomes convenient to take the upstream AssetsDefinitions as a factory argument, because it contains a lot of useful information, such as asset key, group, partitioning, etc.\nFor example, imagine another users-like asset, which may be partitioned and come from a different data source:\n\nA generalized churn-filtering factory may look something like this:\n\nHurray! We were able to build a quite general asset factory. It can be applied to any upstream asset and will carry on such properties as partitioning and group name.\nAs always with factories, it works well until it doesnâ€™t.\nOne thing this factory cannot generalize over is input data. Because the upstream assets are hardcoded into the asset body signature, we cannot change them when calling the factory.\nFor example, imagine we are calculating data science features over some data. Some may be statistical and self-contained, but some may require additional maching learning models to be applied. Features may also depend on each other. This makes feature assets form a complex DAG, which canâ€™t be expressed by the above pattern, because we would need to dynamically define dependencies between features at factory call time. \nHere is how we solve it: we write more factories. Joking.\nExtending the @asset decorator\nLuckily for us, a better solution exists, and itâ€™s called functools.wraps.\nBy using it, we can not only dynamically pass the upstream features dependencies to Dagster, but also use the same neat API by specifying them as function arguments.\nfunctools.wraps is a handly utility made especially for writing decorators. It carries function metadata from the decorated function to the decorator body. Letâ€™s take a look at how it works: \n\n\nThe inner wrapper function now has the same .__doc__, .__name__, and in fact, the same signature, as our say_hello function! \nNow, letâ€™s use it to build a customized @asset decorator. \n\nThis pattern is very general and powerful. You get the idea, itâ€™s possible to inject any code into the resulting asset both from the factory and from the compute_fn decorated by my_asset_decorator. It can also take arbitrary Dagster Resources and upstream Assets as input. Itâ€™s possible to make the custom asset decorator as complex and fine-grained as needed, potentially injecting additional asset dependencies or resources or something even more crazy which I canâ€™t think of right now.\nConclusion\nThe pattern of extending the dagster.asset decorator by using functools.wraps is a powerful tool for creating reusable and flexible data pipelines. It allows for dynamic definition of dependencies between assets, which is crucial for complex data processing tasks. It is a testament to the flexibility and power of Dagsterâ€™s asset-based programming model.\n","id":"https://danielgafni.github.io/website/pr-preview/pr-6/blog/custom-dagster-asset-decorator/","title":"Customizing Dagster's asset decorator"},"https://danielgafni.github.io/website/pr-preview/pr-6/pages/":{"body":"","id":"https://danielgafni.github.io/website/pr-preview/pr-6/pages/","title":""},"https://danielgafni.github.io/website/pr-preview/pr-6/projects/":{"body":"My awesome projects!\n","id":"https://danielgafni.github.io/website/pr-preview/pr-6/projects/","title":"Projects"},"https://danielgafni.github.io/website/pr-preview/pr-6/projects/dagster-polars/":{"body":"dagster-polars allows loading and saving polars DataFrames from Dagsterâ€™s @assets and @ops. It supports multiple serialization formats and storage systems. \nIt started as my standalone project, but eventually got merged into the main Dagster repository.\n","id":"https://danielgafni.github.io/website/pr-preview/pr-6/projects/dagster-polars/","title":"dagster-polars"},"https://danielgafni.github.io/website/pr-preview/pr-6/projects/freak/":{"body":"Freak is a Python package which allows interacting with the programâ€™s state remotely. You can define the state object as a pydantic model and use Freak to expose it over HTTP. It supports nested models, partial updates, data validation, and uses FastAPI to run the web server. \nIt can be useful to quickly setup control over long-running programs like bots or neural network trainings.\nHere freak is used to create a PyTorch Lightning Callback for graceful model training interruption. This is particularly useful in distributed training context.\n\n","id":"https://danielgafni.github.io/website/pr-preview/pr-6/projects/freak/","title":"Freak"}},"docInfo":{"https://danielgafni.github.io/website/pr-preview/pr-6/":{"body":4,"title":1},"https://danielgafni.github.io/website/pr-preview/pr-6/about/":{"body":17,"title":0},"https://danielgafni.github.io/website/pr-preview/pr-6/archive/":{"body":0,"title":1},"https://danielgafni.github.io/website/pr-preview/pr-6/blog/":{"body":2,"title":1},"https://danielgafni.github.io/website/pr-preview/pr-6/blog/custom-dagster-asset-decorator/":{"body":405,"title":4},"https://danielgafni.github.io/website/pr-preview/pr-6/pages/":{"body":0,"title":0},"https://danielgafni.github.io/website/pr-preview/pr-6/projects/":{"body":2,"title":1},"https://danielgafni.github.io/website/pr-preview/pr-6/projects/dagster-polars/":{"body":24,"title":2},"https://danielgafni.github.io/website/pr-preview/pr-6/projects/freak/":{"body":58,"title":1}},"length":9},"lang":"English"}